import Carrousel from './Carousel';
import '../Styles/Home.css';

function Home () {
  return (
    <div>
      <h3 card>! Jobless</h3>
      <div className="card">
        <p className='card-title'>Account login</p>
      </div>
      <div className='card'> 
        <p className='company-name'>Find a job</p>
      </div>
      <div className='card'>
        <p className='card-title'>See companies</p>
      </div>
    </div>
  )
}

export default Home;
